import React, { useState, useEffect } from 'react';
import { getSharedBluebooksApi } from '../../apis/Api';
import { ToastContainer, toast } from 'react-toastify';

const SharedBluebooks = () => {
    const [sharedBluebooks, setSharedBluebooks] = useState([]);
    const [loading, setLoading] = useState(true);

    useEffect(() => {
        fetchSharedBluebooks();
    }, []);

    const fetchSharedBluebooks = async () => {
        try {
            const loggedInUserId = JSON.parse(localStorage.getItem('user'))._id;

            const response = await getSharedBluebooksApi();
            setSharedBluebooks(response.data.sharedBluebooks);
            setLoading(false);
        } catch (error) {
            console.error('Error fetching shared bluebooks:', error);
            toast.error('Error fetching shared bluebooks');
        }
    };

    return (
        <div className="shared-bluebooks-container">
            <h2>Shared Bluebooks</h2>
            {loading ? (
                <p>Loading...</p>
            ) : sharedBluebooks.length === 0 ? (
                <p>No shared bluebooks found.</p>
            ) : (
                <ul>
                    {sharedBluebooks.map((sharedBluebook, index) => (
                        <li key={index}>
                            <h3>{sharedBluebook.bluebook.bluebookName}</h3>
                            <p>Registration Authority: {sharedBluebook.bluebook.registrationAuthority}</p>
                            <p>Vehicle Class: {sharedBluebook.bluebook.vehicleClass}</p>
                            <p>Bluebook Status: {sharedBluebook.bluebook.bluebookStatus}</p>
                            <p>Fuel Type: {sharedBluebook.bluebook.fuelType}</p>
                            {/* Add other bluebook details here */}
                            <p>Shared By: {sharedBluebook.sharedBy}</p>
                            <p>Shared At: {new Date(sharedBluebook.sharedAt).toLocaleString()}</p>
                        </li>
                    ))}
                </ul>
            )}
            <ToastContainer />
        </div>
    );
};

export default SharedBluebooks;
